import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    console.log("this is my initializer");

    const movies = [
      {id: 0, poster_source: "https://www.google.ca/imgres?imgurl=https%3A%2F%2Fimages-na.ssl-images-amazon.com%2Fimages%2FI%2FA1aHRPvn5JL._RI_.jpg&imgrefurl=https%3A%2F%2Fwww.amazon.com%2FAvengers-Infinity-Robert-Downey-Jr%2Fdp%2FB07CKV3RGL&docid=7h6Q0cxSZMPXXM&tbnid=aSgHwaUohk1MjM%3A&vet=10ahUKEwis7MXY4oHeAhUCTd8KHQP0Ah4QMwhgKAEwAQ..i&w=1920&h=2560&bih=921&biw=564&q=avengers%3A%20infinity%20war&ved=0ahUKEwis7MXY4oHeAhUCTd8KHQP0Ah4QMwhgKAEwAQ&iact=mrc&uact=8", title: "Avengers: Infinity War", overview: "As the bla bla blah AND THEN MORE BLAH BLAH BLAH... Thanos win's!"},
      {id: 1, poster_source: "https://www.google.ca/imgres?imgurl=https%3A%2F%2Fterrigen-cdn-dev.marvel.com%2Fcontent%2Fprod%2F1x%2Ftheavengers_lob_crd_03.jpg&imgrefurl=https%3A%2F%2Fwww.marvel.com%2Fmovies%2Fthe-avengers&docid=zfNjuystYUzlKM&tbnid=lu3OczX6vxbTcM%3A&vet=10ahUKEwjrzcjm4oHeAhXic98KHeIZBFUQMwhzKAcwBw..i&w=382&h=566&bih=921&biw=564&q=avengers&ved=0ahUKEwjrzcjm4oHeAhXic98KHeIZBFUQMwhzKAcwBw&iact=mrc&uact=8", title: "The Avengers", overview: "This is my second overview"},
      {}
    ]

    var movieRows = [];
    movies.forEach((movie) => {
      console.log(movie.title)
      const movieRow = <table key={movie.id}>
        <tbody>
          <tr>
            <td>
              <img alt="poster" src="{movie.poster_source}"/>
            </td>
            <td>
              {movie.title}
            </td>
          </tr>
        </tbody>
      </table>
      movieRows.push(<p key={movie.id}>{movie.title}</p>)
    })

    this.state ={rows: movieRows}
  }

  render() {
    return (
      <div className="App">
        <table className="titleBar">
          <tbody>
            <tr>
              <td>
                <img alt="app icon" width="100" src="image2vector.svg"/>
              </td>
              <td width="15"/>
              <td>
                <h1>Movies DB Search</h1>
              </td>
            </tr>
          </tbody>
        </table>

        <input style={{
          fontSize: 24,
          display: 'block',
          width: "99%",
          paddingTop: 8,
          paddingBottom: 8,
          paddingLeft: 50,
        }} placeholder="Enter search term"/>  

        {this.state.rows}



      </div>
    );
  }
}

export default App;
